export class VersionData {
    static get latestRelease() {
        return this.versionStrings[this.versionStrings.length - 1][0];
    }
    static getVersionString(release) {
        for (let i = this.versionStrings.length - 1; i >= 0; i--) {
            const versionRelease = this.versionStrings[i][0];
            if (release === versionRelease) {
                return this.versionStrings[i][1];
            }
            else if (release > versionRelease) {
                return `> ${this.versionStrings[i][1]}`;
            }
        }
        return "< 1.0";
    }
}
